"use strict";
var config = require("./singletons/config/config");
var memory = require("@startx/probot-memory");
const oauth_1 = require("./protocols/oauth/oauth");
module.exports = function (properties) {
    var i;
    for (i in properties) {
        config[i] = properties[i];
    }
    return {
        config,
        memory,
        protocols: {
            oAuth: new oauth_1.oAuth(),
        }
    };
};
